import gql from 'graphql-tag';

export const GET_PLAYER = gql`
  query GetPlayer($playerAbbr:String!){
    dashPlayer(playerAbbr: $playerAbbr) {
      demographicData {
        playerAbbr,
        firstName,
        lastName
      },
      playerGames {
        gameId,
        passingAttemptsAmt,
        passingCompletionsAmt,
        seasonYear
      }
    }
  }
`;
